// In each test context: Define fake HTTP request class using scraped routes.

beforeEach(function() {
  foam.CLASS({
    name: 'FakeHTTPRequest',
    package: 'org.chromium.webidl.crawlers.test',
    extends: 'foam.net.HTTPRequest',

    requires: ['org.chromium.webidl.crawlers.test.Route'],

    properties: [
      {
        name: 'routes',
        value: global.gitiles_test_routes,
      },
    ],

    methods: [
      function send() {
        if (!this.url)
          throw new Error('FakeHTTPRequest expects URL-based construction');

        var payload = this.routes[this.url];
        if (!payload) {
          return Promise.resolve(this.HTTPResponse.create({
            status: 404,
            payload: Promise.resolve('Not found'),
          }));
        }

        return Promise.resolve(this.HTTPResponse.create({
          status: 200,
          payload: payload,
        }));
      },
    ],
  });
});
